import React from 'react';
import { Drawer } from '@mui/material';
const SideBar = () => {
  return (
    <Drawer
      anchor="left"
      open={true}
      hideBackdrop={true}
      ModalProps={{ keepMounted: true }}
      variant="persistent"
      sx={{
        '& .MuiDrawer-paper': {
          marginTop: '64px',
          width: 250,
          background: '#f5f5f5',
        },
      }}
    >
      Hello from SideBar
    </Drawer>
  );
};

export default SideBar;
